    // }
    
    return(
        <div className="container">
            <div><h2>{title}</h2></div>
            <hr />
            <table className="table table-striped table-responsive">
                <thead>
                    <th>Company</th>
                    {/* <th>Company Id</th> */}
                    <th>Model</th>
                    <th>Fuel Type</th>
                    <th>Km</th>
                    <th>Price</th>
                    <th>Color</th>
                    <th>Date</th>
                    <th>City</th>
                </thead>
                <tbody>
            {
                // items.map((item)=>{
                //     return(
                //         <tr>
                //             <td>{item.carId}</td>
                //             {/* <td>{item.companyId}</td> */}
                //             <td>{item.modelId}</td>
